import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      projects: [
        {
          name: 'Corona Test',
          id: 'pr1'
        },
        {
          name: 'Simple Weather',
          id: 'pr2'
        },
        {
          name: 'Router Library',
          id: 'pr3'
        },
        {
          name: 'Flappy Bird',
          id: 'pr4'
        },
        {
          name: 'ToDo pwa',
          id: 'pr5'
        },
        {
          name: 'Portfolio',
          id: 'pr6'
        },
        {
          name: 'Hangman',
          id: 'pr7'
        }
      ]
    }
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
